import React from "react";
import "./home.css"
import { Punjabi,Roti,Gujrati,Chinese } from "./Apimenu";
import { NavLink } from "react-router-dom";
const Ourmenu = () => {
  return (
    <>
      <section className="menu-section">
        <div className="container">
          <div className="row">
            <div className="border flex">
            </div>
            <div className="content">
              <div className="heading">
                <span>special selection</span>
                <h2>our menu</h2>
              </div>
              <div className="main-box">
              <div className="box">
                <div className="punjabi">
                <ul className="punjabi">
                  {
                    Punjabi.map((data) => {
                      const {id,name,price}=data
                      return(
                        <li key={id}><NavLink><h2>{name}</h2><span>{price}</span></NavLink></li>
                      )
                    })
                  }
                  </ul>
                  <ul className="chinese">
                  {
                    Chinese.map((data) => {
                      const {id,name,price}=data
                      return(
                        <li key={id}><NavLink><h2>{name}</h2><span>{price}</span></NavLink></li>
                      )
                    })
                  }
                  </ul>
                  <ul className=" ">
                  {
                    Roti.map((data) => {
                      const {id,name,price}=data
                      return(
                        <li key={id}><NavLink><h2>{name}</h2><span>{price}</span></NavLink></li>
                      )
                    })
                  }
                  </ul>
                </div>
              </div>
              <div className="box">
                <div className="chinese">
               
                </div>
              </div>
              <div className="box">
                <div className="Roti">
              
                </div>
              </div>
              <div className="box">
                <div className="Gujrati">
                <ul>
                  {
                    Gujrati.map((data) => {
                      const {id,name,price}=data
                      return(
                        <li key={id}><NavLink><h2>{name}</h2><span>{price}</span></NavLink></li>
                      )
                    })
                  }
                  </ul>
                </div>
              </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
export default Ourmenu;
